// import React from 'react'
import "../Sass/_componentLogin.scss";
import {Container, Row, Col, Form, Button} from 'react-bootstrap';
import React, { useState } from 'react';

const Login = () => {
    // return (
    //     <>
    //     <Container className="login-signup-page">
    //   <Row>
    //     <Col xs={12} md={6} className="login-section">
    //       <h2>Log In</h2>
    //       <Form>
    //         <Form.Group controlId="formUsername">
    //           <Form.Label>Username</Form.Label>
    //           <Form.Control type="text" placeholder="Enter username" />
    //         </Form.Group>
    //         <Form.Group controlId="formPassword">
    //           <Form.Label>Password</Form.Label>
    //           <Form.Control type="password" placeholder="Enter password" />
    //         </Form.Group>
    //         <Button variant="primary" type="submit">Log In</Button>
    //       </Form>
    //     </Col>
    //     <Col xs={12} md={6} className="signup-section">
    //       <h2>Sign Up</h2>
    //       <Form>
    //         <Form.Group controlId="formFullName">
    //           <Form.Label>Full Name</Form.Label>
    //           <Form.Control type="text" placeholder="Enter full name" />
    //         </Form.Group>
    //         <Form.Group controlId="formEmail">
    //           <Form.Label>Email</Form.Label>
    //           <Form.Control type="email" placeholder="Enter email" />
    //         </Form.Group>
    //         <Form.Group controlId="formUsername">
    //           <Form.Label>Username</Form.Label>
    //           <Form.Control type="text" placeholder="Enter username" />
    //         </Form.Group>
    //         <Form.Group controlId="formPassword">
    //           <Form.Label>Password</Form.Label>
    //           <Form.Control type="password" placeholder="Enter password" />
    //         </Form.Group>
    //         <Button variant="primary" type="submit">Sign Up</Button>
    //       </Form>
    //     </Col>
    //   </Row>
    // </Container>
    // </>
    // )
    const [showLogin, setShowLogin] = useState(true);

  const handleToggleForm = () => {
    setShowLogin(!showLogin);
  };

  return (
    <Container className="login-signup-page">
      <Row>
        {showLogin ? (
          <Col xs={12} md={6} className="login-section">
            <h2>Log In</h2>
            <Form>
              <Form.Group controlId="formUsername">
                <Form.Label>Username</Form.Label>
                <Form.Control type="text" placeholder="Enter username" />
              </Form.Group>
              <Form.Group controlId="formPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Enter password" />
              </Form.Group>
              <Button variant="primary" type="submit">
                Log In
              </Button>
              <Button variant="link" onClick={handleToggleForm}>
                Create an account
              </Button>
            </Form>
          </Col>
        ) : (
          <Col xs={12} md={6} className="signup-section">
            <h2>Sign Up</h2>
            <Form>
              <Form.Group controlId="formFullName">
                <Form.Label>Full Name</Form.Label>
                <Form.Control type="text" placeholder="Enter full name" />
              </Form.Group>
              <Form.Group controlId="formEmail">
                <Form.Label>Email</Form.Label>
                <Form.Control type="email" placeholder="Enter email" />
              </Form.Group>
              <Form.Group controlId="formUsername">
                <Form.Label>Username</Form.Label>
                <Form.Control type="text" placeholder="Enter username" />
              </Form.Group>
              <Form.Group controlId="formPassword">
                <Form.Label>Password</Form.Label>
                <Form.Control type="password" placeholder="Enter password" />
              </Form.Group>
              <Button variant="primary" type="submit">
                Sign Up
              </Button>
              <Button variant="link" onClick={handleToggleForm}>
                Already have an account? Log in
              </Button>
            </Form>
          </Col>
        )}
      </Row>
    </Container>
  );

  const [activePart, setActivePart] = useState('login');

  const handleSwitchPart = () => {
    setActivePart(activePart === 'login' ? 'signup' : 'login');
  };

  return (
    <div>
      <div className={`login-form ${activePart === 'login' ? 'active fade-in' : 'inactive fade-out'}`}>
        {/* Conteúdo do formulário de login */}
      </div>

      <div className={`login-form ${activePart === 'signup' ? 'active fade-in' : 'inactive fade-out'}`}>
        {/* Conteúdo do formulário de signup */}
      </div>

      <button onClick={handleSwitchPart}>Trocar Parte</button>
    </div>
  );
}

export default Login;
